package com.test;

import java.util.ArrayList;
import java.util.HashMap;
import java.util.Map;
import java.util.Scanner;

/*
 * 给定一个字符串，请将字符串里的字符按照出现的频率降序排列。
 * 输入:
 * "tree"
 * 输出：
 * "eetr" 或者 "eert" 都属于正确的答案
 * 
 */
public class Mid_451_frequencySort {
	public static void main(String[] args) {
		Scanner scanner = new Scanner(System.in);
		//String s = "";
		String s = scanner.nextLine();
		System.out.println(frequencySort(s));
	}
	public static String frequencySort(String s) {
        Map<Character, Integer> map = new HashMap<Character, Integer>();
        int maxTimes = 0;
        for (int i = 0; i < s.length(); i++) {
			if (map.containsKey(s.charAt(i))) {
				map.put(s.charAt(i), map.get(s.charAt(i))+1);
			}else {
				map.put(s.charAt(i), 1);
			}
			maxTimes = map.get(s.charAt(i)) > maxTimes ? map.get(s.charAt(i)) : maxTimes;
		}
        ArrayList<Character>[] buckets = new ArrayList[maxTimes+1];
        for(Character c:map.keySet()) {
        	int freq = map.get(c);
        	if (buckets[freq] == null) {
				buckets[freq] = new ArrayList<Character>();
			}
        	buckets[freq].add(c);
        }
        // 这里使用StringBuild可以加速长字符传的处理
        StringBuilder stringBuilder = new StringBuilder();
        for(int i = maxTimes; i >= 0 ;i--) {
        	if (buckets[i] == null) {
				continue;
			}
        	for(char c:buckets[i]) {
        		for(int j = 0;j<i;j++) {
        			stringBuilder.append(c);
        		}
        	}
        }
        //System.out.println(result);
        return stringBuilder.toString();
    }
}
